import React from "react";
import { useNavigate } from "react-router-dom";
import { FiArrowLeft } from "react-icons/fi";

export default function Configuracoes() {
  const navigate = useNavigate();
  return (
    <div style={{
      minHeight: "100vh",
      background: "linear-gradient(120deg,#101824 0%,#1c2740 100%)",
      color: "#fff",
      fontFamily: "Segoe UI, Inter, Arial, sans-serif",
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      paddingTop: 48,
    }}>
      <h2 style={{ fontSize: 30, fontWeight: 800, letterSpacing: 1, marginBottom: 22, color: "#0eb8d0" }}>Configurações do Usuário</h2>
      <div style={{
        background: "#222e47",
        borderRadius: 14,
        padding: "24px 28px",
        minWidth: 340,
        boxShadow: "0 2px 16px #0eb8d055"
      }}>
        <div style={{ fontSize: 18, color: "#0eb8d0", marginBottom: 10, fontWeight: 700 }}>
          Personalização (em breve)
        </div>
        <div style={{ color: "#c7edff", fontSize: 16 }}>
          Em breve será possível personalizar logotipo, cabeçalho dos laudos, aparência do sistema e definir preferências.<br/><br/>
          Sugira recursos que gostaria de ver!
        </div>
      </div>
      <button
        onClick={() => navigate(-1)}
        style={{
          marginTop: 32,
          background: "#232f4e",
          color: "#0eb8d0",
          fontWeight: 700,
          border: "2px solid #0eb8d0",
          borderRadius: 8,
          fontSize: 18,
          padding: "10px 24px",
          boxShadow: "0 2px 8px #00e0ff20",
          cursor: "pointer",
          display: "flex",
          alignItems: "center",
          gap: 8
        }}
      >
        <FiArrowLeft size={22}/> Voltar
      </button>
    </div>
  );
}
